      this.scene.pan2Dxyzmm[3] = zoom;
      const mm = this.frac2mm(this.scene.crosshairPos);
      this.scene.pan2Dxyzmm[0] += zoomChange * mm[0];
      this.scene.pan2Dxyzmm[1] += zoomChange * mm[1];
