      testNeighbor([-1, -1, -1]);
      testNeighbor([1, -1, -1]);
      testNeighbor([-1, 1, -1]);
      testNeighbor([1, 1, -1]);
      testNeighbor([-1, -1, 1]);
      testNeighbor([1, -1, 1]);
