    this.gl.uniform1i(shader.uniforms.colormap, 1);
    this.gl.uniform1i(shader.uniforms.overlay, 2);
    this.gl.uniform1i(shader.uniforms.drawing, 7);
    this.gl.uniform1i(shader.uniforms.paqd, 8);
